import React from 'react';

const Index = () => {
    const handlePrev = () =>{
        console.log('sebelum')
    }
    const handleNext = () =>{
        console.log('sesudah')
    }
    return (
        <div>
             <nav aria-label="Page navigation example">
                <ul class="pagination">
                    <li class="page-item"><a class="page-link" onClick={handlePrev} >Previous</a></li>
                    <li class="page-item"><a class="page-link" >1</a></li>
                    <li class="page-item"><a class="page-link" >2</a></li>
                    <li class="page-item"><a class="page-link" >3</a></li>
                    <li class="page-item"><a class="page-link"onClick={handleNext} >Next</a></li>
                </ul>
            </nav>
        </div>
    );
}

export default Index;
